import React from 'react';
import MusicCard from './MusicCard';  // Import MusicCard

const MusicList = ({ musicData, onSelectMusic }) => {
    return (
        <div className="music-list">
            {musicData.map((music) => (
                <MusicCard
                    key={music.id}
                    music={music}
                    onClick={() => onSelectMusic(music)}
                />
            ))}
        </div>
    );
};

export default MusicList;
